Lightning McQueen is een ambitieuze nieuweling in de racewereld die onderweg is naar de finale van de Pistons Cup in California. 
Wanneer hij onverwachts een omweg moet maken door het slaperige Route 66 stadje: Radiator Springs, ontdekt hij dat het leven niet 
om de finishlijn gaat maar om de reis. Onderweg leert hij ongewone karakters kennen; Sally, een chique Porsche uit 2002, Doc 
Hudson (een Hudson Hornet uit 1951 met een mysterieus verleden) en Mater, een roestige maar betrouwbare sleepwagen. Zij helpen 
Lighting McQueen te realiseren dat er belangrijkere dingen in het leven zijn dan prijzen, reputatie, roem en sponsors:
